import gql from 'graphql-tag';

export const FETCH_USERS = gql`
  query {
    fetch_users {
        userId
        firstName
        middleName
        lastName
        documentNumber
        documentType
        email
        address
        phone
        organization
    }
  }
`;

export const FETCH_TOPIC_QUERY =gql`
 {
  getTopics {
    username
    id
    topic
    description    

  }
}

`
